import Get from "./Get";
import POST from "./Post";
header("Access-Control-Allow-Origin", "*");
header("Access-Control-Allow-Headers", "Origin, X-Requested-With, Content-Type, Accept");
//getuser
const getUser = () => Get('user/all');

//postuser
const postUser = (data) => POST('user/save',data);


const GENI = {
    getUser,
    postUser
}

export default GENI;
